import {/*  Avatar, *//*  Button, */ List, Skeleton } from 'antd';
import React, { useEffect, useState } from 'react';
import { ArticlesApi } from '../request/api';


export default function ListList() {


  const [list, setList] = useState([]);


  useEffect(()=>{
    ArticlesApi().then(res=>{
      console.log(res)
      setList(res.data.arr)
    })

  },[])






  return (
    <List
      className="demo-loadmore-list"
      itemLayout="horizontal"
      dataSource={list}
      renderItem={(item) => {
        console.log(item)
        return (
        <List.Item
          actions={[<a key="list-loadmore-edit">编辑</a>, <a key="list-loadmore-more">more</a>]}
        >
          <Skeleton
            title={false}
            loading={item.loading}
            active>
            <List.Item.Meta
              title={<a href="#">{item.title}</a>}
              description={item.subTitle}
            />
            <div>date</div>
          </Skeleton>
        </List.Item>
      )}
    }
    />
  )
}
